import React, { useState } from "react";
import { Box, Button, IconButton, Popover, Typography } from "@mui/material";
import MenuIcon from "@mui/icons-material/Menu";
import CloseIcon from "@mui/icons-material/Close";
import "./NavBar.css";

const NavBar = () => {
  const [buggerOpen, setBuggerOpen] = useState(false);
  const [anchorEl, setAnchorEl] = React.useState(null);
  const openPopover = () => {};
  const handleClick = (event) => {
    setAnchorEl(event.currentTarget);
  };

  const handleClose = () => {
    setAnchorEl(null);
  };
  const open = Boolean(anchorEl);
  const id = open ? "simple-popover" : undefined;
  return (
    <Box className="navBar_body">
      <Typography sx={{ fontSize: "32px", fontWeight: "bold" }}>
        COZ Shopping
      </Typography>
      <IconButton
        className="Btn_bugger"
        size="large"
        onClick={() => {
          setBuggerOpen(!buggerOpen);
        }}
      >
        <MenuIcon className="icon_bugger" />
      </IconButton>
      <Popover
        id={id}
        open={open}
        anchorEl={anchorEl}
        onClose={handleClose}
        anchorOrigin={{
          vertical: "bottom",
          horizontal: "left",
        }}
      >
        <Button>
          <Typography> 오승찬님, 안녕하세요!</Typography>
        </Button>
        <Button>
          <Typography>상품리스트 페이지</Typography>
        </Button>
        <Button>
          <Typography>북마크 페이지</Typography>
        </Button>
      </Popover>
    </Box>
  );
};

export default NavBar;
